import { useEffect, useState , useContext} from "react"
import axios from "axios"
import { NavLink } from "react-router-dom"
import { API } from "../api"
import { AuthContext } from "../contexts/AuthContext"
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import {useHistory} from 'react-router-dom';


function CountryList() {
  const [countries, setCountries] = useState(null)
  const { user ,logout } = useContext(AuthContext)
  const history = useHistory();


  useEffect(() => {
    function fetchCountries() {
      axios.get(API.countries.list)
        .then(res => {
          console.log(res.data)
          setCountries(res.data)
        })
    }
    fetchCountries()
    return () => null
  }, [])

  return (
    <div>
        {!countries && "Loading..."}
        {countries && countries.map((country, i) => {

            return (


            <div key={i}>
              {user ? (
                // <NavLink to={`/countries/${country.id}`}>
                   <Card sx={{ maxWidth: 345 }}>
                      <CardActionArea  onClick = {() => history.push(`/countries/${country.id}`)}>
                        <CardMedia
                          component="img"
                          height="140"
                          image={country.country_image}
                          alt={country.country_image}
                        />
                        <CardContent>
                          <Typography gutterBottom variant="h5" component="div">
                           {country.country_name}
                          </Typography>
                          <Typography variant="body2" color="text.secondary">
                           {country.content}
                          </Typography>
                        </CardContent>
                      </CardActionArea>
                    </Card>
                // </NavLink>
                ):(
                  <NavLink to={`/countries/login`}>
                  {country.country_name}: {country.content}
                 </NavLink>

              )}   
            </div>


            )

        })}

    </div>
  );
}

export default CountryList
